@Test
  public void testNvl() throws Exception {
    assertNull(nvl(null, null));

    for (int i = 0; i < 100; ++i) {
      assertNotNull(ObjectUtils.nvl(randomUUID().toString(), randomUUID().toString()));
    }

    for (int i = 0; i < 100; ++i) {
      assertNotNull(ObjectUtils.nvl(randomUUID().toString(), randomUUID().toString(),
          randomUUID().toString()));
    }
  }

